import React from 'react';
import { Link } from 'react-router-dom';
import styles from './Sidebar.module.css';

const Sidebar = ({ item }) => {
  return (
    <Link to={item.path}>
      {item.icon}
      <span className={styles.span}>{item.title}</span>
      {item.subNav && subnav
        ? item.iconOpened
        : item.subNav
        ? item.iconClosed
        : null}
    </Link>
  );
};

export default Sidebar;
